import React, { Component } from "react";

class SingleBuyOrder extends Component {
	render() {
		return (
			<React.Fragment>
				{typeof this.props.order.id != "undefined"
					? this.props.order.id
					: "Loading"}
			</React.Fragment>
		);
	}
}

export default SingleBuyOrder;
